window.ymcaSearchComponent={loggedIn:!1,async:!0,renderResultsNow:!1,familyName:"Not logged in.",filters:{familyCenter:"",zipCode:"",program:"",dayOfTheWeek:"",times:""},familyCenters:[],programs:[],init:async function(e,t,s,n){this.config(e,t,s,n),this.programs=await fetch("programs.json",{mode:"cors"}).then(e=>e.json()),this.familyCenters=await fetch("familyCenters.json",{mode:"cors"}).then(e=>e.json()),this.render(),this.renderResultsNow&&this.search()},config:function(e,t,s,n){this.filters.familyCenter=e.familyCenter,this.filters.zipCode=e.zipCode,this.filters.program=e.program,this.filters.daysOfTheWeek=e.daysOfTheWeek,this.filters.times=e.times,this.loggedIn=t,this.async=s,this.renderResultsNow=n},render:function(){document.getElementById("ymca-search-component").innerHTML=`<div class='ymca-component-search'>\n                    <div class='ymca-component-search-header'>Search Programs</div>\n                    <div class="ymca-component-family-logged-in">Family: ${this.familyName}</div>\n                        ${this.getFamilyCentersRendered()}\n                        <input class="ymca-component-zipcode ymca-component-input" placeholder="ZIP Code" value='${this.filters.zipCode}'></input>\n                        ${this.getProgramsRendered()}\n                        <div class="ymca-component-search-button-container"><button class="ymca-component-search-button" onclick="ymcaSearchComponent.search()" type="button">Search</button></div>\n                    </div>\n                </div>`},getSearchResultsRender:function(){return fetch("ymcaPrograms.json").then(e=>e.json()).then(e=>e.map(e=>`<div class="ymca-search-result">\n                                                <div class="ymca-search-result-title">${e.title}</div>\n                                                <div class="ymca-search-result-body">\n                                                    <div class="ymca-search-result-times">${e.times}</div>\n                                                    <div class="ymca-search-result-details">${e.details}</div>\n                                                    <div class="ymca-search-result-actions">\n                                                        <a href="" class="details-action">Details</a>\n                                                        <a href="" class="visit_action">Visit This Y</a>\n                                                    </div>\n                                                </div>\n                                            </div>`).join(""))},getProgramsRendered:function(){return`<select class='ymca-program-select ymca-component-select' name='ymca-programs'>${this.programs.map(e=>this.filters.program===e.value?`<option value='${e.value}' selected>${e.name}</option>`:`<option value='${e.value}'>${e.name}</option>`).join("")}</select>`},getFamilyCentersRendered:function(){return`<select class='ymca-family-center-select ymca-component-select' name='ymca-family-center'>${this.familyCenters.map(e=>this.filters.familyCenter===e.value?`<option value='${e.value}' selected>${e.name}</option>`:`<option value='${e.value}'>${e.name}</option>`).join("")}</select>`},search:function(){this.async?this.getSearchResultsRender().then(e=>{document.getElementById("ymca-search-results").innerHTML=e}):window.location.href=window.location.hostname}};